import React, { Component } from 'react'
import "../../Css/PostProject.css";

export default class PostProject extends Component {

    onChange(e){
         this.setState({[e.target.name]: e.target.value});
     }
      onSubmit(e){
         e.preventDefault();

        //  const newUser = {
        //    email: this.state.email,
        //    password: this.state.password,
        //  };
        //  this.props.register(newUser, this.props.history);
     }
    render() {
        return (
             <div className="postProject">
                <div className="navName">
                    <h4>Post Project</h4>
                    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Quos, quaerat eaque. Harum sunt explicabo quam minima veniam possimus odit officiis?</p>
                </div>
                <hr/>
                <div className="postProject_body">
                    <form className="registerForm" onSubmit={this.onSubmit}>
                            <h5>Project Title</h5>
                            <input type='text'  
                            name= 'title'
                            value={this.state.name} 
                            onChange={this.onChange} 
                            />

                            <h5>Project Description</h5>
                            <textarea type='text'
                            name= 'description'
                            value={this.state.name}
                            onChange={this.onChange}  
                                    />
                                    <h5>Required Skills</h5>
                            <input type='text'
                            name= 'skills'
                            value={this.state.name}
                            onChange={this.onChange}  
                                    />
                                    <h5>Project Budget</h5>
                            <input type='text'
                            name= 'budget'
                            value={this.state.name}
                            onChange={this.onChange}  
                                    />
                    <div className="other">
                        <div>Have Account.<Link to="/login" style={{textDecoration:0}}><span className="accountRouting">Login</span></Link></div>
                        <button type='submit' className='registerBtn'>Register</button>
                    </div>
                </form>
                </div>
            </div>
        )
    }
}
